  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `semester` int NOT NULL DEFAULT '1',
  `urutan` int NOT NULL DEFAULT '0',
  `modul_id` bigint unsigned DEFAULT NULL,
